package com.fenbeitong.openapi.plugin.func.company.entity;import lombok.AllArgsConstructor;import lombok.Builder;import lombok.Data;import lombok.NoArgsConstructor;import javax.persistence.Column;import javax.persistence.Id;import javax.persistence.Table;import java.util.Date;/** * Created by huangsiyuan on 2021/09/01. */@Data@Builder@AllArgsConstructor@NoArgsConstructor@Table(name = "open_bill_ext_info")public class OpenBillExtInfo {    /**     * 主键     */    @Id    @Column(name = "id")    private String id;    /**     * 公司ID     */    @Column(name = "company_id")    private String companyId;    /**     * 1:因公;2:因私     */    @Column(name = "account_type")    private Integer accountType;    /**     * 订单ID     */    @Column(name = "order_id")    private String orderId;    /**     * 票ID     */    @Column(name = "product_id")    private String productId;    /**     * 场景类型     */    @Column(name = "category")    private Integer category;    /**     * 场景类型名称     */    @Column(name = "category_name")    private String categoryName;    /**     * 原始数据     */    @Column(name = "src_data")    private String srcData;    /**     * 扩展数据     */    @Column(name = "ext_data")    private String extData;    /**     * 1:正常;2:异常     */    @Column(name = "status")    private Integer status;    /**     * 创建时间     */    @Column(name = "create_time")    private Date createTime;    /**     * 更新时间     */    @Column(name = "update_time")    private Date updateTime;}